CÁMARA DE MINERÍA FELICITA AL PRESIDENTE DANIEL NOBOA POR SU TRIUNFO EN LAS ELECCIONES 2025 
@mariaeulalias
, presidenta Ejecutiva de la Cámara de
@mineriaecuador
, se refirió al triunfo de Daniel Noboa y María José Pinto en las elecciones que se desarrollaron el domingo 13 de abril en Ecuador.

 | “¡No los defraudará!” Donald Trump felicita a Daniel Noboa tras su reelección en Ecuador. 

El presidente de Estados Unidos, Donald Trump, celebró la reelección de Daniel Noboa en las elecciones presidenciales de Ecuador 2025 con un mensaje directo y entusiasta:

“Felicitaciones a Daniel Noboa, quien será un gran líder para el maravilloso pueblo de Ecuador. ¡No los defraudará!”

#LaElección2025 | La felicitación fue publicada en su red social, Truth Social, después de que Noboa se impusiera por amplia diferencia frente a la candidata del correísmo.

